void icon_show(unsigned short  x, unsigned short  y, unsigned short  width, unsigned short  height, const unsigned char* pstr,unsigned char ishow)//
{

	u16 i,j;
    unsigned int len = 0;	
	

	
 	for(i=0;i<height;i++)
	{
 		LCD_SetCursor(x,y+i);   	// 
		for(j=0;j<width;j++) 
		{
				if(ishow==1)	LCD->LCD_RAM=((pstr[2*len]<<8)+pstr[2*len+1]);// 
				else	LCD->LCD_RAM=BLACK;// 	
			len++;
		}
		
	}	  
	
	
	
		
	

	
	
	
}





void icon_show_enlarge(unsigned short  x, unsigned short  y, unsigned short  width, unsigned short  height, const unsigned char* pstr,unsigned char ishow,unsigned char ienlarge)//
{

	u16 i,j,k,l;
    unsigned int len = 0;	
	

	
 	for(i=0;i<height;i++)
	{
		for(l=0;l<ienlarge;l++)		
		{		
			LCD_SetCursor(x,y+ienlarge*i+l);   	// 
			for(j=0;j<width;j++) 
			{
					if(ishow==1)	
					{
						for(k=0;k<ienlarge;k++)	LCD->LCD_RAM=((pstr[2*len]<<8)+pstr[2*len+1]);// 
					}
					else	
					{
						for(k=0;k<ienlarge;k++)	LCD->LCD_RAM=BLACK;// 	
					}
				
				len++;
			}
			if(l<(ienlarge-1))	len-=width;//
		}
	}	  
}

void icon_show_narrow(unsigned short  x, unsigned short  y, unsigned short  width, unsigned short  height, const unsigned char* pstr,unsigned char ishow,unsigned char inarrow)//
{

	u16 i,j,k,l;
    unsigned int len = 0;	
	

	
 	for(i=0;i<(height/inarrow);i++)
	{
 		LCD_SetCursor(x,y+i);   	// 
		for(j=0;j<(width/inarrow);j++) 
		{
				if(ishow==1)	LCD->LCD_RAM=((pstr[2*len]<<8)+pstr[2*len+1]);// 
				else	LCD->LCD_RAM=BLACK;// 	
			 	
			for(k=0;k<inarrow;k++)len++;
		}
		if((width%inarrow)==1)	len+=1;
		if((width%inarrow)==2)	len+=2;
		if((width%inarrow)==3)	len+=3;		
		
		for(l=0;l<(inarrow-1);l++)	len+=width;
	}	  
	
}












